import { useEffect, useState } from "react";
import API from "../api";
import ProductCard from "../components/ProductCard";

export default function ProductCatalog() {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState("");
  const [showAvailableOnly, setShowAvailableOnly] = useState(false);
  const [showOnOfferOnly, setShowOnOfferOnly] = useState(false);
  const [error, setError] = useState(null);
  const [currentPage, setCurrentPage] = useState(1);
  const productsPerPage = 20;

  useEffect(() => {
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      setError(null);
      const res = await API.get("/products");

      // ✅ Normalize fields as booleans
      const normalizedProducts = res.data.map((p) => ({
        ...p,
        available: p.available === true || p.available === "true" || p.available === 1,
        onOffer: p.onOffer === true || p.onOffer === "true" || p.onOffer === 1,
      }));

      setProducts(normalizedProducts);
    } catch (error) {
      console.error("Error fetching products:", error);
      setError(`Failed to load products: ${error.message}`);
    } finally {
      setLoading(false);
    }
  };

  const filteredProducts = products.filter((product) => {
    const matchesSearch =
      product.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      (product.description &&
        product.description.toLowerCase().includes(searchTerm.toLowerCase()));

    const matchesAvailability = !showAvailableOnly || product.available === true;
    const matchesOnOffer = !showOnOfferOnly || product.onOffer === true;

    return matchesSearch && matchesAvailability && matchesOnOffer;
  });

  // Pagination
  const totalPages = Math.ceil(filteredProducts.length / productsPerPage);
  const startIndex = (currentPage - 1) * productsPerPage;
  const endIndex = startIndex + productsPerPage;
  const currentProducts = filteredProducts.slice(startIndex, endIndex);

  const availableCount = products.filter((p) => p.available).length;
  const offerCount = products.filter((p) => p.onOffer).length;

  useEffect(() => {
    setCurrentPage(1);
  }, [searchTerm, showAvailableOnly, showOnOfferOnly]);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <div className="space-y-8">
      {/* Header */}
      <div className="p-8 text-center bg-white shadow-lg rounded-2xl">
        <h1 className="text-4xl font-bold">Welcome to Nadir Brothers</h1>
        <div className="flex justify-center gap-4 mt-4">
          <div>📦 {products.length} Total Products</div>
          <div>✅ {availableCount} Available</div>
          <div>🏷️ {offerCount} On Offer</div>
        </div>
      </div>

      {/* Filters */}
      <div className="flex flex-col items-center gap-4 p-6 bg-white shadow-lg rounded-2xl md:flex-row">
        <input
          type="text"
          placeholder="Search products..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          className="flex-1 px-4 py-2 border rounded-xl"
        />
        <label className="flex items-center gap-2">
          <input
            type="checkbox"
            checked={showAvailableOnly}
            onChange={(e) => setShowAvailableOnly(e.target.checked)}
          />
          Show available only
        </label>
        <label className="flex items-center gap-2">
          <input
            type="checkbox"
            checked={showOnOfferOnly}
            onChange={(e) => setShowOnOfferOnly(e.target.checked)}
          />
          Show on offer only
        </label>
      </div>

      {/* Products */}
      <div className="grid grid-cols-1 gap-6 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4">
        {currentProducts.map((product) => (
          <ProductCard key={product._id} product={product} />
        ))}
      </div>
    </div>
  );
}
